import Footer from '../components/Footer';
import DemoProduct from '../components/DemoProduct';

function Product() {
  return (
    <>
        <Header />
        <Banner />
       <HeadSlider />
       <Demoproduct />
        <Footer />
    </>

  )
}

export default Product
